  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '殖民奖金表；主键id',
  `name` varchar(200) DEFAULT NULL COMMENT '城镇或者副本名称',
  `type` int(2) DEFAULT NULL COMMENT '0副本 1城镇',
  `price` int(20) DEFAULT '0' COMMENT '单次通关奖励',
