  `clearancecount` int(20) DEFAULT '0' COMMENT '通关次数',
  `pid` int(20) DEFAULT NULL COMMENT '角色id',
  `ismax` int(2) DEFAULT '0' COMMENT '0没有达到最大值  1达到最大值（通关奖励的金币数量）',
