  `init_y` int(10) NOT NULL COMMENT '角色出现在下一张场景的y坐标',
  `resourceId` int(10) NOT NULL COMMENT '传送阵的资源ID',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

