DROP TABLE IF EXISTS `tb_guild_app`;

CREATE TABLE `tb_guild_app` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '记录的id',
  `guildID` int(20) NOT NULL COMMENT '军团的ID号',
  `applicant` int(20) NOT NULL COMMENT '申请人的ID',
