DROP TABLE IF EXISTS `tb_nobility_astrict`;

CREATE TABLE `tb_nobility_astrict` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '爵位领取俸禄记录 每天只能领取一次',
  `pid` int(20) DEFAULT NULL COMMENT '角色id',
