  `isgx` varchar(30) DEFAULT '[]' COMMENT '上交的物品[1,3,5]代表 f1 f2 f3',
  `counts` int(20) DEFAULT '1' COMMENT '上交钻石次数',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=320 DEFAULT CHARSET=utf8;

