/*Table structure for table `tb_punish` */

DROP TABLE IF EXISTS `tb_punish`;

CREATE TABLE `tb_punish` (
  `qlevel` int(5) NOT NULL DEFAULT '1' COMMENT '强化等级 (强化失败惩罚表) 没有记录的说明该强化等级没有惩罚',
