/*Table structure for table `tb_repurchase` */

DROP TABLE IF EXISTS `tb_repurchase`;

CREATE TABLE `tb_repurchase` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '物品出售记录ID',
