  `skillId` int(11) NOT NULL COMMENT '技能的id',
  `skillLevel` int(11) DEFAULT '1' COMMENT '技能的等级',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

