insert  into `tb_technology`(`technology`,`technologyName`,`technologyDes`,`icon`,`technologyMaxLevel`,`curSchedule`,`technologyFormula`) values (800001,'困難挑戰','啟動該技能後，可進入困難難度副本；',7,1,10,'info[\'kunnan\'] = True'),(800002,'力量','每級增加角色的力量屬性5點，最高等級為20級。軍團等級每提升5級，此技能提升1級。',6,20,10,'info[\'str\'] = 5*level'),(800003,'敏捷','每級增加角色的敏捷屬性5點，最高等級為20級。軍團等級每提升5級，此技能提升1級。',1,20,10,'info[\'dex\'] = 5*level'),(800004,'智力','每級增加角色的智力屬性5點，最高等級為20級。軍團等級每提升5級，此技能提升1級。',2,20,10,'info[\'wis\'] = 5*level'),(800005,'耐力','每級增加角色的耐力屬性5點，最高等級為20級。軍團等級每提升5級，此技能提升1級。',5,20,10,'info[\'vit\'] = 5*level'),(800006,'戰鬥技巧','每級增加角色的物理攻擊10點，最高等級為10級。此技能31級開啟，軍團等級每提升7級，此技能升1級。',6,10,10,'info[\'phyatt\'] = 10*level'),(800007,'魔力精通','每級增加角色的魔法攻擊10點，最高等級為10級。此技能31級開啟，軍團等級每提升7級，此技能升1級。',0,10,10,'info[\'migatt\'] = 10*level'),(800008,'防禦精通','每級增加角色的物理防禦和魔法防禦各10點，最高等級為10級。此技能31級開啟，軍團等級每提升7級，此技能升1級。',6,10,10,'info[\'PhyDef\'] = 10*level;info[\'MigDef\'] = 10*level'),(800009,'殖民領地','啟動該技能後，可增加殖民地上限。最高等級為20級，軍團等級每增加5級，此技能提升1級。',3,10,10,''),(800010,'英雄試煉','啟動該技能後，可進入英雄難度副本；此技能在軍團等級達到36級時開啟。',7,1,10,'info[\'yingxion\'] = True');

